import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        React Movies Form
      </a>
      <a className="navbar-brand" href="/Saved">
        React Saved list
      </a>
    </nav>
  );
}

export default Nav;
